import "./App.css";
import { useEffect, useState } from "react";
import Navbar from "./components/NavigationBar.js";
import Services from "./components/Services"
import Experiences from './components/Experiences'
import Footer from "./components/FooterCom";
import GoogleFont from 'react-google-fonts';
import { motion } from "framer-motion";
import Project1 from './components/Project1.jpg';
import Project2 from './components/Project2.jpg';
import Project3 from './components/Project3.jpg';
import Project4 from './components/Project4.jpg';
import Project5 from './components/Project5.jpg';
import Pics from './Pics.jpg';
import { duration } from "@material-ui/core";


function App() {

  const [mousePosition, setMousePosition] = useState({
    x: 0,
    y: 0
  });
  const [cursorVariant, setCursorVariant] = useState("default");


  useEffect(() => {
    const mouseMove = e => {
      setMousePosition({
        x: e.clientX,
        y: e.clientY
      })
    }

    window.addEventListener("mousemove", mouseMove);

    return () => {
      window.removeEventListener("mousemove", mouseMove);
    }
  }, []);

  const variants = {
    default: {
      x: mousePosition.x - 8,
      y: mousePosition.y - 8,
    },
    wide: {
      width: 100,
      height: 100,
      x: mousePosition.x - 50,
      y: mousePosition.y - 50,
      backgroundColor: 'white'
    }

    }

  const imgEnter = () => setCursorVariant('wide')
  const imgLeave = () => setCursorVariant('default')


  return (
    <div className="App" >


      <motion.div className='SecondCursor'
        variants={variants}
        animate={cursorVariant}
        transition={{duration:0.01}}
      />


      <GoogleFont font='Manrope' />

          <div className='AppNavbar'>
            <Navbar/>
          </div >

          <div className='PageWrapper' style={{ paddingLeft:40, paddingRight:40 , backgroundColor:'#f0f0f0'}}>

              <div className='Body'>

                <div className="BodyLeft">

                    <div><h4>Over 6 years and over 10 real life projects. I create digital products and content with aesthetics and usability concerns. 
                    </h4>
                    </div>

                    <div>
                    <h4 className='LastUpdated'>Last Updated <span>15.05.203</span></h4>
                    </div>

                </div>

                <div className="BodyRight">

                  <p><span className="Designer">Ux/Ui Designer</span> and <span className="Developer"> Jr Front End Developer </span>currently based in Istanbul</p>

                </div>

              </div>

              <div className='Projects'>

                  <div className='Row'>

                    <div className='FirstProject'>
                    <img onMouseEnter={imgEnter} onMouseLeave={imgLeave} src={Project1}  style={{borderRadius:24}} className="project"/>
                    </div>

                    <div className='SecondProject' >
                    <img onMouseEnter={imgEnter} onMouseLeave={imgLeave} src={Project2} style={{borderRadius:24}} className="project" />
                    </div>

                  </div>

                  <div className='midddleRow'>

                    <div className='ThirdProject'>
                    <img onMouseEnter={imgEnter} onMouseLeave={imgLeave} src={Project3}  style={{borderRadius:24}} className="project"/>
                    </div>

                  </div>

                  <div className='Row'>

                    <div className='FourthProject'>
                    <img onMouseEnter={imgEnter} onMouseLeave={imgLeave} src={Project4}  style={{borderRadius:24}} className="project"/>
                    </div>

                    <div className='FifthProject' >
                    <img onMouseEnter={imgEnter} onMouseLeave={imgLeave} src={Project5} style={{borderRadius:24}} className="project" />
                    </div>

                  </div>

                  <button className='allwork' >All Works</button>

              </div>


              <div className='Info'>

                  <div className='services'>
                      <h4 className='ServicesTitle'>Some of Our Services</h4>
                      <Services title='Ux/Ui Design'/>
                      <Services title='Web&App Design'/>
                      <Services title='Brand Identity'/>
                      <Services title='Marketing'/>
                      <Services title='Social Media'/>
                  </div>

                  <div className='Summary'>
                        <div className='Summary'>
                        <h3 claasName='SumTitle'>Currently working at <span className='SolidBox'>Solid-ICT</span>. And have been working in the design industry for 6 years. </h3>
                        </div>

                        <div>
                            <div className='SummaryBody' style={{maxWidth:500}}>
                              <p className='sump'>  I believe that I have a great sense of aesthetic. 
                                    I can frankly tell the difference between the beautiful and ugly. 
                                    Besides, I have a strong focus on the impact of my design on the people. 
                                    I like the direct interaction with the users of the product I'm working on and I like to see and contribute the story of that. 
                                    I am willing to learn whatever is needed for the task.
                              </p>
                            </div>
                            <button className='ReadMore'>Read More</button>
                        </div>

                  </div>

              </div>

              </div>

              <div className='BigPic' style={{backgroundColor:'#f0f0f0'}}>
                <img className='picbig' src={Pics} />
              </div>

              <div className='Experience' style={{paddingTop:144, display:'flex', justifyContent:'space-between',
              paddingLeft:40, paddingRight:40 , backgroundColor:'#f0f0f0'}}>

                <div className='ExpLeft'>
                  <h3 className='ExpTitle'>Experiences&Articles</h3>
                </div>

                <div className='ExpRight' style={{justifyContent:'space-between', width:640, marginBottom:144}}>
                  <Experiences name='Inverse Proportion Between Growth and UX' year='2023'/>
                  <Experiences name='Solid-ICT' year='2022'/>
                  <Experiences name='WeHelp&WeDance' year='2022'/>
                  <Experiences name='Jungle' year='2021'/>

                </div>


           </div>


          <div className= 'footer' style={{backgroundColor:'#191919', paddingLeft:40, paddingRight:40, paddingTop:120}}>

              <Footer/>

          </div>


    </div>
  );
}

export default App;
